import PropTypes from 'prop-types';
import BookDetail from './BookDetail';
function Book({book, showDetail}){

    const showBookDetail =()=>{
        console.log('showing book detail', book);
    }
    return(
        <>
        <table onDoubleClick = {()=>showDetail(book)}>
            <thead>
            <tr draggable="true">
                <td>{book.title}</td>
                <td>{book.author}</td>
                <td>{book.isbn}</td>
                <td>{book.year}</td>
            </tr>
            </thead>
        </table>
        <BookDetail />
        </>
    )
}
Book.propTypes={
    title: PropTypes.string,
    author: PropTypes.string,
    isbn: PropTypes.number,
    year: PropTypes.string
}
export default Book;
